create database Cuahangdienthoai
go
use Cuahangdienthoai
go
--Mac dinh trang thai
--1 la con
--0 la da bi xoa
create table TAIKHOAN
(
Mataikhoan int identity(0,1) not null,
Username nvarchar(60) not null,
Pass nvarchar(60) not null,
Trangthai int not null,
Manhanvien int not null,
Loainhanvien int not null,
constraint PK_TK primary key (Mataikhoan)
)
alter table TAIKHOAN add constraint TK_TThai check(Trangthai = 1 OR Trangthai = 0 )

--Mac dinh trang thai
--1 la con
--0 la da bi xoa

create table NHANVIEN
(
Manhanvien int identity(0,1) not null,
Tennhanvien nvarchar(60) not null,
CMND varchar(20) not null,
Gioitinh nvarchar(3) not null,
Diachi nvarchar(60) not null,
Ngaysinh datetime not null,
Sodienthoai varchar(20) not null,
Trangthai int not null,
Hinhanh image ,
constraint PK_NV primary key (Manhanvien)
)
alter table NHANVIEN add constraint NV_TThai check(Trangthai = 1 OR Trangthai = 0 )
alter table NHANVIEN add constraint NV_Gioitinh check(Gioitinh = N'Nam' OR Gioitinh = N'Nữ' )


create table HANG
(
Mahang int identity(0,1) not null,
Tenhang nvarchar(60) not null,
constraint PK_HANG primary key (Mahang)
)
create table NHAPHATHANH
(
Manhaphathanh int identity(0,1) not null,
Tennhaphathanh nvarchar(60) not null,
constraint PK_NPH primary key (Manhaphathanh)
)
create table HIEU
(
Mahieu int identity(0,1) not null,
Mahang int not null,
Tenhieu nvarchar(60) not null,
constraint PK_HIEU primary key (Mahieu)
)

--mac dinh trang thai 
--1 la con
--0 la xoa
create table SANPHAM
(
Masanpham int identity(0,1) not null,
Mahang int not null,
Mahieu int not null,
Tensanpham nvarchar(60) not null,
Thongso nvarchar(100) not null,
Soluong int not null,
Gia int not null,
Giamgia int not null,
Nhaphathanh nvarchar(100) not null,
Trangthai int not null,
Hinhanh image ,
constraint PK_Product primary key(Masanpham)
)
alter table SANPHAM add constraint SP_TThai check(Trangthai = 1 OR Trangthai = 0 )

--mac dinh loaihinhnhap
--1 la nhap moi
--0 la nhap them so luong (update)
create table LICHSUNHAPHANG
(
Malichsu int identity(0,1) not null,
Masanpham int not null,
Soluongnhap int not null,
Giathanh int not null,
Ngaynhap datetime not null,
Loaihinhnhap int not null,
constraint PK_LSNK primary key (Malichsu)
)
alter table LICHSUNHAPHANG add constraint LS_LHN check(Loaihinhnhap = 1 OR Loaihinhnhap = 0 )




create table KHUYENMAI
(
ID int identity(0,1) not null,
Macode varchar(15) not null,
Ngayhethan datetime not null,
Giam int not null,
Trangthai int not null,
constraint PK_Khuyenmai primary key(ID)
)



create table BLACKFRIDAY
(
Mangay int identity(0,1) not null,
NgayBF datetime not null,
Sukien nvarchar(60) not null,
Giam int not null,
Trangthai int not null,
constraint PK_BF primary key(Mangay)
)

create table DONHANG
(
Madonhang int identity (0,1) not null,
Tenkhachhang nvarchar(60) not null,
Sodienthoai varchar(60) not null,
Diachigiaohang nvarchar(60) not null,
Ngaydathang datetime not null,
Ngaygiaohang datetime not null,
Tongtien float not null,
Tienthanhtoan float not null,
Hinhthucthanhtoan int not null,
Magiamgia varchar(15) null,
constraint PK_Donhang primary key(Madonhang)
)
create table CHITIETDONHANG
(
Machitiet int identity(0,1) not null,
Madonhang int not null,
Mahang int not null,
Mahieu int not null,
Masanpham int not null,
Soluong int not null,
Dongia float not null,

constraint PK_CTDH primary key(Machitiet)
)
alter table CHITIETDONHANG add 
	Constraint FK_CT_DH foreign key (Madonhang) references DONHANG(Madonhang),
	Constraint FK_CT_HANG foreign key (Mahang) references HANG(Mahang),
	Constraint FK_CT_HIEU foreign key (Mahieu) references HIEU(Mahieu),
	Constraint FK_CT_SP foreign key (Masanpham) references SANPHAM(Masanpham)

alter table SANPHAM add 
	Constraint FK_SP_HANG foreign key (Mahang) references HANG(Mahang),
	Constraint FK_SP_HIEU foreign key (Mahieu) references HIEU(Mahieu)
alter table LICHSUNHAPHANG add 
	Constraint FK_LS_SP foreign key (Masanpham) references SANPHAM(Masanpham)
alter table TAIKHOAN add 
	Constraint FK_TK_NV foreign key (Manhanvien) references NHANVIEN(Manhanvien)


